import React, {Component} from 'react';

const DATA = 'http://localhost:3004/modules';

class Reading extends Component {
    constructor (props) {
        this.state = {
            data: ''
        }
    }

    componentDidMount() {
        fetch (DATA, {method: 'GET'})
        .then (response => response.json())
        .then ()
    }

    render () {
        return (
            <div>Reading</div>
        )
    }
}

export default Reading;
